[DEFAULT]
sys_include = -isysroot /Applications/Xcode.app/Contents/Developer/Platforms/MacOSX.platform/Developer/SDKs/MacOSX10.14.sdk -I/Applications/Xcode.app/Contents/Developer/Toolchains/XcodeDefault.xctoolchain/usr/lib/clang/10.0.0/include -I/Applications/Xcode.app/Contents/Developer/Toolchains/XcodeDefault.xctoolchain/usr/include/c++/v1
qtdir = /Developer/Qt/5.9.8/clang_64
qtcore_include = %(qtdir)s/lib/QtCore.framework/Headers
qtgui_include = %(qtdir)s/lib/QtGui.framework/Headers
qtnetwork_include = %(qtdir)s/lib/QtNetwork.framework/Headers

default_operators = tr@0#trUtf8@0#operator=@set(?)void#operator+@add#operator-(?)@sub#operator-()@neg#operator*@mul#operator/@div#operator+=@inc(?)void#operator-=@dec(?)void#operator*=@multiplyBy(?)void#operator/=@divideBy(?)void#operator==@equals#operator!=@notEquals#operator<@lessThan#operator>@greaterThan#operator<=@lessOrEqual#operator>=@greaterOrEqual#operator[]@at#qt_check_for_QGADGET_macro@0

default_arguments = -x c++ -std=c++11 -arch x86_64 -mmacosx-version-min=10.10 -DNDEBUG -DQT_NO_DEBUG -DQT_CORE_LIB -DQT_GUI_LIB -DQT_NETWORK_LIB %(sys_include)s -I%(qtcore_include)s -I%(qtgui_include)s -I%(qtnetwork_include)s -I%(qtdir)s/mkspecs/macx-clang